Static variables are used to store data that needs to be persistent between function calls. They are initialized only once, at the start of the program, and their values are retained between function calls. Static variables are declared with the static keyword and can be used to store data that is shared between multiple functions.

Local variables are used to store data that is only used within a single function. They are initialized each time the function is called and their values are not retained between function calls. Local variables are declared without any keyword and can only be accessed within the function in which they are declared.

In summary, static variables are used to store data that needs to be persistent between function calls, while local variables are used to store data that is only used within a single function.

